var lines = 10;
var wordsPerLine = 4;
var minWordLength = 5;
var maxWordLength = 10;
var seperator = '-';
var probabilityRealWord = 0;


function getRandomInt(min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

function generateRealWord() {
  return englishWords[getRandomInt(0, englishWords.length - 1)];
}

