  passw = '';
  for (j = 0; j < wordsPerLine; j++) {
     if (Math.random() > probabilityRealWord) {
       passw += generateNonsenceWord();
     } else {
       passw += generateRealWord();
     }
     if (j < (wordsPerLine -1)) { passw += seperator; }
  }
